import React from "react";
function Hero() {
  return (
    <section className="container-fluid" id="supportHero">
      <div className="p-5 mt-5 mb-5" id="supportWraper">
        {/* suportWraper is a id given to those which are used as a container */}
        <h3>Support Portal</h3>
        <a href="">Track Tickets</a>
      </div>
      <div className="row p-5 mt-5 mb-5">
        {/* suportWraper is a id given to those which are used as a container */}
        <div className="col-6 row p-5 mt-5 mb-5">
          <h1>Search for an answer or browse help topics to create a ticket</h1>
          <input placeholder="Eg How do I activate F&O" />
          <a href=""Track account opening></a>
          <a href=""segment activation></a>
         <a href=""Int raday margins></a>
          <a href=""Kite user manual></a>
        </div>
        <div className="col-6 row p-5 mt-5 mb-5">
          <h1>Featured</h1>
        </div>
      </div>
    </section>
  );
}

export default Hero;
